Flotation Toy Warning is a band from London, UK, formed in 2001. Their sound has been described as a cross between space rock and chamber pop, with musical similarities to bands such as Mercury Rev, The Flaming Lips, Grandaddy, Sparklehorse, The Unicorns, and Air. The band claims to consist of various arctic explorers and historians from the 19th century. The band is made up of frontman and lead vocalist Paul Carter, guitar and bass Ben Clay, drummer Colin Coxall, guitar and bass Nainesh Shah, and keyboardist Vicky West. &lt;a href=&quot;
